import React, { Component } from 'react';
import './ParallaxCover.css';
import { Parallax, Background } from 'react-parallax';
import { CoverText, Signature } from '../Text/Text';

class ParallaxCover extends Component {
	render() {
		return (
			<div className="ParallaxCover">
        <Parallax
						strength="200">
						<Background className="custom-bg">
                <img src="http://www.fillmurray.com/500/320" alt="fill murray" />
            </Background>
						<div id="cover" className="Section">
							<div position="center" className="Container">
								<Signature text="{t.cover.signature}"/>
								<CoverText text="{t.cover.text1}"/>
							</div>
						</div>
        </Parallax>
			</div>
		);
	}
}

export { ParallaxCover };
